/*Table structure for table `cliente` */

DROP TABLE IF EXISTS `cliente`;

CREATE TABLE `cliente` (
  `codigo_cliente` int(11) NOT NULL auto_increment,
  `nombre_completo` varchar(100) collate utf8_spanish2_ci default NULL,
  `cargo` varchar(100) collate utf8_spanish2_ci default NULL,
  `unidad` varchar(200) collate utf8_spanish2_ci default NULL,
  `seccion` varchar(50) collate utf8_spanish2_ci default NULL,
  `encargado` varchar(100) collate utf8_spanish2_ci default NULL,
  `programa` varchar(20) character set utf8 default NULL,
  PRIMARY KEY  (`codigo_cliente`)
