/*Table structure for table `config` */

DROP TABLE IF EXISTS `config`;

CREATE TABLE `config` (
  `anio_sistema` char(4) character set utf8 collate utf8_spanish2_ci NOT NULL,
  `bodega` varchar(200) character set utf8 collate utf8_spanish2_ci default NULL,
  `nota_costo_promedio` int(10) default '0',
  `numero_cliente_facultades` varchar(20) character set utf8 collate utf8_spanish2_ci default NULL,
  PRIMARY KEY  (`anio_sistema`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

