/*Table structure for table `detalle_nota_egreso` */

DROP TABLE IF EXISTS `detalle_nota_egreso`;

CREATE TABLE `detalle_nota_egreso` (
  `codigo_detalle_nota_egreso` int(11) NOT NULL auto_increment,
  `codigo_nota_egreso_fk` int(11) default NULL,
  `cantidad` bigint(20) default NULL,
  `unidad` varchar(100) character set utf8 collate utf8_spanish2_ci default NULL,
  `detalle` varchar(200) character set utf8 collate utf8_spanish2_ci default NULL,
  `valor_unitario` bigint(20) default NULL,
  `valor_total` bigint(20) default NULL,
  `estado` int(11) default '0',
  `codigo_distributivo` int(11) default NULL,
  `tmp` int(11) default '0',
  PRIMARY KEY  (`codigo_detalle_nota_egreso`),
  KEY `FK_detalle_nota_egreso` (`codigo_nota_egreso_fk`),
  KEY `FK_detalle_nota_egreso_3` (`codigo_distributivo`),
  CONSTRAINT `FK_detalle_nota_egreso` FOREIGN KEY (`codigo_distributivo`) REFERENCES `producto` (`codigo_producto`),
  CONSTRAINT `FK_detalle_nota_egreso_2` FOREIGN KEY (`codigo_nota_egreso_fk`) REFERENCES `notaegreso` (`codigo_nota`)
) ENGINE=InnoDB AUTO_INCREMENT=221 DEFAULT CHARSET=utf8;

