/*Table structure for table `notaingreso` */

DROP TABLE IF EXISTS `notaingreso`;

CREATE TABLE `notaingreso` (
  `codigo_nota` varchar(50) character set utf8 collate utf8_spanish2_ci NOT NULL,
  `fecha` date NOT NULL,
  `codigo_usuario_fk` varchar(50) character set utf8 collate utf8_spanish2_ci NOT NULL,
  `ruc_proveedor_fk` varchar(13) character set utf8 collate utf8_spanish2_ci NOT NULL,
  `total` bigint(20) unsigned zerofill default NULL,
  `aux` int(11) default '0',
  `estado` int(11) default '0',
  `nfactura` varchar(10) character set utf8 collate utf8_spanish2_ci default NULL,
