  `distribuido` int(11) default '0',
  `secuencial` int(11) default NULL,
  `anulado` int(11) default '0',
  `tipo_proveedor` varchar(5) default NULL,
  `tipo_proceso` varchar(20) default NULL,
  `id_proceso` varchar(50) default NULL,
  `secuencia` varchar(15) default NULL,
  `cp` int(11) default NULL,
  PRIMARY KEY  (`codigo_nota`),
  KEY `FK_notaingreso` (`codigo_usuario_fk`),
  KEY `FK_notaingreso2` (`ruc_proveedor_fk`),
  KEY `FK_notaingreso3` (`cuenta`),
  CONSTRAINT `FK_notaingreso` FOREIGN KEY (`codigo_usuario_fk`) REFERENCES `usuario` (`codigo_usuario`),
  CONSTRAINT `FK_notaingreso3` FOREIGN KEY (`cuenta`) REFERENCES `cuenta` (`id`),
  CONSTRAINT `FK_notaingreso_3` FOREIGN KEY (`ruc_proveedor_fk`) REFERENCES `proveedor` (`ruc`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

