/*Table structure for table `proveedor` */

DROP TABLE IF EXISTS `proveedor`;

CREATE TABLE `proveedor` (
  `ruc` varchar(13) character set utf8 collate utf8_spanish2_ci NOT NULL,
  `nombrecompleto` varchar(300) character set utf8 collate utf8_spanish2_ci default NULL,
  `direccion` text character set utf8 collate utf8_spanish2_ci,
  `telefono` varchar(10) character set utf8 collate utf8_spanish2_ci default NULL,
  `celular` varchar(10) character set utf8 collate utf8_spanish2_ci default NULL,
  `tipo` varchar(10) character set utf8 collate utf8_spanish2_ci default NULL,
  `estado` varchar(20) character set utf8 collate utf8_spanish2_ci default NULL,
  `email` varchar(150) character set utf8 collate utf8_spanish2_ci default NULL,
  PRIMARY KEY  (`ruc`)
